// element - DOMHTMLElement that triggered this function being called
// event - event that triggered this function being called
function casparcgJS(hypeDocument, element, event) {

    function drawFrame() {
        window.requestAnimationFrame(drawFrame)
    }

    window.escapeHtml = function (unsafe) {
        return unsafe.replace(/&/g, "&amp;").replace(/</g, "&lt;").replace(/>/g, "&gt;").replace(/"/g, "&quot;").replace(/'/g, "&#039;")
    }

    var setters = {}

    //define the interface that templates should use
    window.caspar = {
        registerField: function (id, clear, setterFn) {
            if (setterFn != undefined) setters[id] = setterFn
            if (clear) {
                var element = document.getElementById(id)
                if (element != undefined) element.innerHTML = ""
            }
        },

        onPlay: function () { },
        onStop: function () {
            //document.body.style.display = "none"

            //For continue on timeline
            //hypeDocument.continueTimelineNamed("Main Timeline", hypeDocument.kDirectionForward, false)

            //For reverse the timeline
            hypeDocument.continueTimelineNamed("Main Timeline", hypeDocument.kDirectionReverse, false)
        },
        onNext: function () {
            hypeDocument.continueTimelineNamed("Main Timeline", hypeDocument.kDirectionForward, false)
        },
    }

    //called by caspar to set new data
    window.update = function (str) {
        var parser = new DOMParser()
        var xmlDoc = parser.parseFromString(str, "text/xml")

        var data = {}
        var nodes = xmlDoc.documentElement.childNodes

        //loop through all componentData
        for (k = 0; k < nodes.length; k++) {

            var field = nodes[k].getAttribute("id")

            //TODO: ADD possibility to have a field register a data-reader to support different types of
            //data, just default to the format of the textField-data
            var value = nodes[k].childNodes[0].getAttribute("value")

            //save the data in an intermediate storage
            if (field != undefined && value != undefined) data[field] = value
        }

        //loop through all saved data and populate the coresponding html-element
        for (var field in data) {
            var element = document.getElementById(field)
            //if a setter is defined for the field, call that with the new data as parameter
            if (setters[field] != undefined) setters[field](element, data[field])
            // no custom setter
            else {
                //when no custom setter i defined, just set the innerHTML of the element with id equal to field-id to the new data
                if (element != undefined) element.innerHTML = escapeHtml(data[field])
            }
        }
    }

    //called by caspar to play the template
    window.play = function () {
        window.caspar.onPlay()
        window.requestAnimationFrame(drawFrame)
    }

    //called by caspar to stop the template
    window.stop = function () {
        window.caspar.onStop()
    }

    //called by caspar on next
    window.next = function () {
        window.caspar.onNext()
    }


}

// element - DOMHTMLElement that triggered this function being called // event - event that triggered this function being called function auto_center_SizeTextWithBG(hypeDocument, element, event) { /* Olle was here Place TextField, and then enclose it in two groups. (Animate group two) ┌────────────────────┬─────────────────────────────────────────────────────────┬──────────────────────┐ │Group1 │Group2 ╔═══════════════════════════════════════════╗ │ │ │ │ ║ f[n] ║ │ │ │ │ ╚═══════════════════════════════════════════╝ │ │ └────────────────────┴─────────────────────────────────────────────────────────┴──────────────────────┘ Add this function to "On Enter Viewport", in Actions. (To the textfield (f[n])) */
element.style.width = "auto" element.style.left = "auto" element.style.overflow = "hidden" element.style.textOverflow = "ellipsis" element.style.whiteSpace = "nowrap" // Maxwidth maybe
// Fix parent. In hype everything is absolute. (Special for Center) var textparent = element.parentElement textparent.style.position = "relative" textparent.style.display = "flex" textparent.style.justifyContent = "center"
}

